import './App.css';
import { Navbar,Nav,Form,FormControl,Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <>
  <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">Exam Alteration Helper</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#Description">Description</Nav.Link>
      <Nav.Link href="#ExamSchedules">Examschedule</Nav.Link>
      <Nav.Link href="#Contact">Contact Us</Nav.Link>
      <Nav.Link href="#Reviews">Reviews</Nav.Link>
    </Nav>
    <Form inline>
      <Nav.Link href="#home">Admin Login</Nav.Link>
      <Nav.Link href="#features">Faculty Login</Nav.Link>
    </Form>
  </Navbar>
</>

         </div>
  );
}

export default App;
